import React from "react";
import DUMMY_DATA from "../components/Layout/data";

const AllMeetUps = () => {
    return (
        <section>
            <h1>All MeetUps</h1>
            <ul>
                {DUMMY_DATA.map((meetup) => {
                    return (
                        <li key={meetup.id} >{meetup.title}</li>
                    );
                })}
            </ul>
        </section>
    );
}
export default AllMeetUps;
